sys_variable_value.value:
(function execute(inputs, outputs) {

    status=inputs.status;
    if (status == 'Edit Application' || status == 'Application Submitted' || status == 'Initial Scrutiny' || status == 'Scrutiny'|| status == 'Requirement Verification'|| status == 'Underwriting'|| status == 'Payment'|| status == 'Edit Application Completion'|| status == 'Initial Handle Error'|| status == 'Final Handle Error'|| status == 'Requirements Awaited'|| status == 'Underwriting'|| status == 'Counter Offer'|| status == 'Counter Offer Accepted'|| status == 'PreConversion Check'|| status == 'Additional Requirements'|| status == 'Further Requirements'|| status == 'Cancellation Initiated'|| status == 'Cancellation Requirements') {
    outputs.result = 'In Progress';
} else if (status == 'Policy dispatched to Branch' || status == 'Pre-Printing' || status == 'Printing' || status == 'Policy Issued' || status == 'Policy dispatched to Customer' || status == 'Redispatched') {
    outputs.result = 'Issued';
} else if (status == 'Proposal Withdrawn' || status == 'Counter Offer Rejected' || status == 'Cancelled') {
    outputs.result = 'Cancelled';
} else if (status == 'Declined' || status == 'Postponed') {
    outputs.result = 'Rejected';
} 

// ... code ...
})(inputs, outputs);

